{"query":"query FBPage($uid: String!){
  FbPagePagination(
    page: 1
    perPage: 20
    filter: {
			uid: $uid
    }
  ){
    items {
			uid
			lastFetched
			scheduleFrom
			pageInfo{
				engagement
			}
			userInfo{
				media_count
				name
			}
			FbPageInsights {
				payload{
					page_fans
				}
			}

			FbPagePosts{
				postId
			}

			LatestFbPageInsights{
				payload{
					page_fans
				}
			}
    }
  }
}
","variables":{"uid":"301903072085"},"operationName":"FBPage"}

