{"query":"query getEmailSummary($prompt: String!){
	getOpenAICompletion(
		logprobs: 1
		n: 1
		prompt: $prompt
		model: textDavinci003

	) {
		choices {
			text
			logprobs {
				tokens
			}
		}
	}
}
","variables":{"prompt":"This is an email from jedrmeier@gmail.com to brendon@helpify.ai.
 Create a brief summary from the content of the email: 
Jed, 

Super pumped to potentially get to work with you again!

Chatted with Chris and would love for you to get involved immediately at your hourly development rate. Please let me know what that is so I can confirm it all with Chris. Our alternative here is of course grabbing some random person from Upwork - who we won't trust or have as much confidence in. 

Our near term dev target is to have a launched beta product in the next 24 hours - to be deployed against 100 users max. Next target is launching on the Google Marketplace with a more stable backend. We would like to do that ASAP (goal is in the next few days).

Given your experience on the topic I would propose having you own backend development interfacing with GPT3, auth services, etc. 

Please send over your hourly rate and your availability for the next 7 days and next 30 days. Next 7 being more granular. 

We have an absolutely stellar group and expect it to be a good time working with each other. The group would be (subject to change of course).

"}}

